import Layout from "../components/Layout";
import LinkPage from "../components/LinkPage";

const Index = () => {
  return (
    <Layout>
      <h1>내 친구들을 소개할게</h1>
      <LinkPage></LinkPage>
    </Layout>
  );
};

export default Index;
